import Heart from "../heart.png";
import * as styles from "./articleStyles";

const Article = ({ article }) => {
  const { image, username, title, body, favoritesCount } = article;
  return (
    <styles.ArticleWrapper>
      <styles.ArticleInfo>
        <styles.ArticleMeta>
          <styles.ImgContainer to="#">
            <styles.AuthorImg src="#"></styles.AuthorImg>
          </styles.ImgContainer>
          <styles.AuthorMetaContainer>
            <styles.MetaName to="#">{username}</styles.MetaName>
            <styles.MetaDate>Thu Mar 04 2021</styles.MetaDate>
          </styles.AuthorMetaContainer>
        </styles.ArticleMeta>
        <styles.ArticleContent>
          <styles.ArticleTitle>{title}</styles.ArticleTitle>
          <styles.ArticleBody>{body}</styles.ArticleBody>
        </styles.ArticleContent>
        <styles.ReadMoreDiv>Read more...</styles.ReadMoreDiv>
      </styles.ArticleInfo>
      <styles.LikeButton>
        <styles.HeartIcon src={Heart}></styles.HeartIcon>
        {favoritesCount}
      </styles.LikeButton>
    </styles.ArticleWrapper>
  );
};

export default Article;
